import 'package:flutter/material.dart';

class BookingsModel {
  final String sNo;
  final String name;
  final String email;
  final String phoneNumber;
  final String propertyDetails;
  final String rentalPeriod;
  final String imageUrl; // New field for property image

  BookingsModel({
    required this.sNo,
    required this.name,
    required this.email,
    required this.phoneNumber,
    required this.propertyDetails,
    required this.rentalPeriod,
    required this.imageUrl,
  });

  factory BookingsModel.fromJson(Map<String, dynamic> json) {
    return BookingsModel(
      sNo: json["S_NO"] ?? "",
      name: json["Name"] ?? "",
      email: json["Email"] ?? "",
      phoneNumber: json["Phone_number"] ?? "",
      propertyDetails: json["Property_details"] ?? "",
      rentalPeriod: json["Rental_period"] ?? "",
      imageUrl: json["imageUrl"] ?? "data:image/jpeg;base64,", // Placeholder image
    );
  }
}

